import React from 'react';

import { Menu, Row, Col, Button, Carousel } from 'antd';
//import { AppstoreOutlined, SettingOutlined } from '@ant-design/icons';
const Home = () => {
    const contentStyle = {
        height: '560px',

        background: '#fff',
    };
    return (
        <>
            <Row style={contentStyle}>
                <Col span={24} xs={{ order: 2 }} sm={{ order: 1 }} md={{ order: 4 }} lg={{ order: 3 }}>
                    <div className="content">
                        <h2 className="title" >Hãy quyên góp cho những hoạt động mà bạn quan tâm</h2>
                        <div className="commitment">
                            <div className="commitment__tick"><CheckOutlined /></div>
                        </div>
                    </div>


                </Col>
            </Row>

        </>
    );
}

export default Home;
